column8:
Moty's 車両用グリースは、あらゆる条件に対応すべく８タイプを基本ラインナップとしています。<br>
これらの製品群（MG65，MG88 を除く）は、ハブベアリング・ドライブシャフトをはじめ、あらゆる箇所に使用可能です。しかしながら、求められる性能に、より高いレベルで対応する為には、詳細なスペック・走行条件等、出来うる限りの因子を拾い出し考察することが重要となります。<br>
また、これらの製品の他にも特殊グリースの製作も可能です。<br>
<br>
超高温・高負荷条件にさらされるレーシング及びチューニングカーのドライブシャフト等の使用を目的に開発された無滴点タイプです。<br>
<br>
Color:      ゴールド<br>
増粘剤:　   OBCS<br>
ベース:   　PAO<br>
NLGI Grade: ２<br><center>

